#include <bits/stdc++.h>
#define ll long long int
using namespace std;

int main()
{
    ll t;
    cin >> t;
    while (t--)
    {
        ll n, k;
        cin >> n >> k;

        vector<ll> numbers(n);
        for (int i = 0; i < n; ++i)
        {
            cin >> numbers[i];
        }

        ll largestNumber = *max_element(numbers.begin(), numbers.end());
        vector<ll> zeroIndices;

        while (largestNumber > 0)
        {
            largestNumber -= k;
            for (int i = 0; i < n; ++i)
            {
                if (numbers[i] == largestNumber + k)
                {
                    if (numbers[i] - k <= 0)
                    {
                        zeroIndices.push_back(i);
                    }
                    numbers[i] -= k;
                     largestNumber = *max_element(numbers.begin(), numbers.end());
                }
            }
        }

        for (int index : zeroIndices)
        {
            cout << index+1 <<" ";
        }
        cout<<endl;
    }
}

