import java.util.HashSet;
import java.util.Map;
import java.util.Set;
import java.util.concurrent.ConcurrentHashMap;

import static java.util.Collections.unmodifiableSet;

public class Task {

    private Map<String, Set<String>> visitedPages = new ConcurrentHashMap<>();

    public void visitPage(String userId, String pageId) {
        boolean shouldNotify = false;
        Set<String> pages = visitedPages.get(userId);
        if (pages != null) {
            if (pages.size() < 5) {
                HashSet<String> tmpPages = new HashSet<>(pages);
                tmpPages.add(pageId);
                shouldNotify = tmpPages.size() == 5;
                visitedPages.put(userId, unmodifiableSet(tmpPages));
            }
        } else {
            visitedPages.put(userId, Set.of(pageId));
        }

        if (shouldNotify)
            notify(userId);
    }


    public void notify(String userId) {
    }

}
